ue\\/traitements_lot\\/formulaires\\/exemplaire\\/formate_ss_champ\\/parametres\\/!!formulaire\\/nom_plugin","nom":"nom_plugin","valeur":"catalogue\\/traitements_lot\\/elem_formulaire\\/div\\/formate_ss_champ","description":""},{"timestamp":"1486720685","type":"niv2_update_node","chemin":"profiles\\/defaut\\/plugins\\/plugins\\/catalogue\\/traitements_lot\\/formulaires\\/exemplaire\\/formate_ss_champ\\/parametres\\/aide","nom":"aide","valeur":"Ce traitement permet de modifier le contenu d\'un sous-champ de type texte. Diff\\u00e9rentes modifications sont possibles, en fonction de ce que vous indiquez dans \'m\\u00e9thode\' : <br><br>\\n> strtoupper => met tout le sous-champ en majuscules <br><br>\\n> strtolower => met tout le sous-champ en minuscules <br><br>\\n> ucfirst => met la premi\\u00e8re lettre en majuscule <br><br>\\n> str_replace : remplace certaines lettres par d\'autres par exemple, dans un r\\u00e9sum\\u00e9, remplacer bananes par oranges : il faut alors mettre bananes dans  \'remplacer...\' et oranges dans \'par...\' <br>\\n<b>NOTE<\\/b> Si on veut juste rajouter du texte au d\\u00e9but ou \\u00e0 la fin d\'un sous-champ, mettre #debut# ou #fin# dans \'remplacer par...\' <br><br>\\n> preg_replace : utilisateurs avanc\\u00e9s : utilise une expression r\\u00e9guli\\u00e8re pour modifier le sous-champ voir http:\\/\\/php.net\\/manual\\/fr\\/function.preg-replace.php. \'remplacer...\' correspond \\u00e0 pattern et \'par...\' correspond \\u00e0 replacement <br>","description":""},{"timestamp":"1486720701","type":"niv2_update_node","chemin":"profiles\\/defaut\\/plugins\\/plugins\\/catalogue\\/traitements_lot\\/formulaires\\/exemplaire\\/formate_ss_champ\\/parametres\\/plugin_execution\\/nom_plugin","nom":"nom_plugin","valeur":"catalogue\\/traitements_lot\\/traitements\\/div\\/formate_ss_champ","description":""},{"timestamp":"1486720729","type":"niv2_create_node","chemin":"profiles\\/defaut\\/plugins\\/plugins\\/catalogue\\/traitements_lot\\/liste_traitements